import Card from "./Card" 
import Sdata from "./Sdata"



function ncard(val) {/* All Sdata object will come in "val" since using "map func" */

<>
<h1 className="heading_style"> Most Watched Netflix Webseries </h1>

 {Sdata.map((val) =>{
               return (

            
        <Card 
 key={val.key}       
 imgsrc={val.imgsrc}
 title={val.title}
 sname= {val.sname}
 link={val.link} /> 
 )
               })

 }

         
    </>
   
}

export default Card
